`},{en:"Risk Factors",es:"Factores De Riesgo",fr:"Facteurs de Risque",zh:""},{code:"_previous_eye_surgery_title",en:"Previous Eye|Surgery",es:"",fr:"",zh:""},{code:"_previous_eye_surgery_text",en:"Eye surgery often involves cutting corneal nerves and can result in anatomical misalignment between the ocular surface and eyelid surfaces, which can disrupt tear film homeostasis",es:"",fr:"",zh:""},{code:"_previous_eye_surgery_icon",en:"Previous Eye|Surgery",es:"",fr:"",zh:""},{en:"Sleep",es:"Dormir",fr:"Sommeil",zh:""},{code:"_sleep_text",en:"Poor sleep quality and quantity are associated with an increased risk of dry eye disease, especially less than 5 hours sleep per night. Encourage good sleeping habits to help reduce the risk of dry eye symptoms.",es:"Una mala calidad y cantidad de sueo, especialmente menos de 5 horas por noche, se asocia a un mayor riesgo de padecer la enfermedad del ojo seco. Fomente buenos hbitos de sueo para ayudar a reducir el riesgo de desarrollar sntomas de ojo seco.",fr:"Une qualit et une quantit insuffisantes de sommeil, en particulier moins de 5 heures par nuit, sont associes  un risque accru de scheresse oculaire. Encouragez de bonnes habitudes de sommeil pour aider  rduire le risque de symptmes de scheresse oculaire.",zh:"5"},{en:"Contact Lens",es:"Lentes De Contacto",fr:"Lentilles de contact",zh:""},{code:"_contact_lens_text",en:"Contact lenses can disrupt the tear film and risk causing friction with the ocular surface and so should be carefully optimized, especially in those with pre-existing ocular surface disease.",es:"Las lentes de contacto pueden alterar la pelcula lagrimal y provocar friccin con la superficie ocular, por lo que su uso debe ser  optimizado cuidadosamente, especialmente en personas con enfermedades preexistentes de la superficie ocular.",fr:"Les lentilles de contact peuvent perturber le film lacrymal et risquent de provoquer des frictions avec la surface oculaire ; elles doivent donc tre soigneusement optimises, en particulier chez ceux ayant une affection prexistante de la surface oculaire.",zh:""},{en:"Digital Eye Strain",es:"Fatiga Ocular",fr:"Fatigue visuelle",zh:""},{code:"_digital_eye_strain_text",en:"Digital screen viewing can exacerbate ocular surface disease, especially more than 4-5 hours a day. The impact can be reduced by taking regular breaks, blink exercises, and positioning screens lower than the eyes.",es:"La visualizacin prolongada de pantallas digitales, especialmente por ms de 4-5 horas al da, puede agravar las enfermedades de la superficie ocular. Se puede reducir este impacto tomando descansos regulares, realizando ejercicios de parpadeo y colocando las pantallas a una altura inferior a la de los ojos.",fr:"L'utilisation d'crans numriques peut exacerber les affections de surface oculaire, surtout quand elle a lieu plus de 4-5 heures par jour. Son impact peut tre diminu en prenant des pauses rgulires, en faisant des exercices de clignement des yeux et en positionnant les crans plus bas que les yeux.",zh:"4-5"},{en:"Environment Advice",es:"Ambiente",fr:"Environnement",zh:""},{code:"_environment_advice_icon",en:"Environment|Advice",es:"Ambiente",fr:"Environnement",zh:""},{code:"_environment_advice_text",en:"Environmental conditions such as air-conditioning and windy conditions can contribute to dry eye; a review of when the dry eye symptoms are worst can allow for targeting the necessary adaptations.",es:"Las condiciones ambientales, como el aire acondicionado y el viento, pueden contribuir a la sequedad ocular. Revisar cundo los sntomas del ojo seco son ms intensos puede ayudar a identificar y realizar las adaptaciones necesarias.",fr:"Des conditions environnementales telles que la climatisation ou des courants d'air peuvent contribuer  la scheresse oculaire. Se renseigner sur les moments o les symptmes sont les plus marqus peut permettre de cibler les adaptations ncessaires.",zh:""},{en:"Hormones",es:"Hormonas",fr:"Hormones",zh:""},{code:"_hormones_text",en:"Hormones regulate many key physiological body processes, so changes can disrupt the precisely balanced tear film. When hormones are changing, a medical review might be warranted.",es:"Las hormonas regulan muchos procesos fisiolgicos clave del organismo, y sus cambios pueden alterar el equilibrio de la pelcula lagrimal. Por lo tanto, cuando ocurren cambios hormonales, puede ser necesario realizar una revisin mdica.",fr:"Les hormones rgulent de nombreux processus physiologiques du corps, de sorte que des changements peuvent perturber l'quilibre prcis du film lacrymal. En prsence de changements hormonaux, un examen mdical peut tre ncessaire.",zh:""},{en:"Medication Review",es:"Revisin De Medicamentos",fr:"Mdicaments",zh:""},{code:"_medication_review_text",en:"Many medications, whether prescribed or over-the-counter, can affect the tear film, so a medication review, in conjunction with the prescribing clinician, might allow for symptoms to be reduced.",es:"Muchos medicamentos, tanto con receta como sin ella, pueden afectar la pelcula lagrimal. Por ello, una revisin de la medicacin junto con el mdico que la prescribe podra ayudar a reducir los sntomas.",fr:"De nombreux mdicaments, qu'ils soient prescrits ou en vente libre, peuvent affecter le film lacrymal. Ainsi, une revue des mdicaments, en collaboration avec le mdecin prescripteur, pourrait permettre d'attnuer les symptmes.",zh:""},{en:"Triaging",es:"Triaje",fr:"Triage",zh:""},{en:"Symptom Check",es:"Historia Y Sntomas",fr:"Symptmes et histoire de cas",zh:""},{code:"_symptom_check_text",en:"History-taking: Careful history-taking allows identification of dry eye symptoms as well as risks associated with the development of dry eye disease. Modifiable risk factors are especially important to identify, as simple changes in lifestyle can help reduce or eliminate their impact, and promote a healthier ocular surface.",es:"Una anamnesis detallada permite identificar los sntomas del ojo seco y los riesgos asociados con el desarrollo de esta enfermedad. Es particularmente importante reconocer los factores de riesgo modificables, ya que simples cambios en el estilo de vida pueden ayudar a reducir o eliminar su impacto, promoviendo as una superficie ocular ms saludable.",fr:"Histoire de cas : Une anamnse mticuleuse permet d'identifier  les symptmes de scheresse oculaire ainsi que les risques associs au dveloppement de l'il sec. Il est particulirement important de dterminer les facteurs de risque modifiables, car des changements simples dans le mode de vie peuvent aider  rduire ou  liminer leur impact et favoriser une surface oculaire plus saine.",zh:""},{en:"Differential Diagnosis",es:"Diagnstico Diferencial",fr:"Diagnostic diffrentiel",zh:""},{code:"_differential_icon",en:"Differential|Diagnosis",es:"Diagnstico|Diferencial",fr:"Diagnostic|diffrentiel",zh:""},{code:"_contact_lens_icon",en:"Contact|Lens",es:"Lentes De|Contacto",fr:"Lentilles|de contact",zh:""},{code:"_eye_strain_icon",en:"Digital|Eye Strain",es:"Fatiga|Ocular",fr:"Fatigue|visuelle",zh:""},{code:"_medication_review_icon",en:"Medication|Review",es:"Revisin De|Medicamentos",fr:"Mdicaments",zh:""},{code:"_symptom_check_icon",en:"Symptom|Check",es:"Historia Y|Sntomas",fr:"Symptmes et|histoire de cas",zh:""},{code:"_differential_header",fr:"La scheresse oculaire n'est qu'une des nombreuses affections de la surface oculaire. Le diagnostic diffrentiel permet de s'assurer qu'il n'existe pas d'autre affection sous-jacente, telle qu'une allergie ou une infection oculaire, qui soit responsable des symptmes. Traiter les comorbidits avant de traiter toute scheresse oculaire rsiduelle, afin d'augmenter les chances de succs pour le patient. La liste de vrification pour le triage TFOS DEWS II permet d'affiner rapidement et facilement le diagnostic et d'viter des visites cliniques inutiles.",zh:"TFOS DEWS II"},{code:"_differential_list",fr:`
